import React from "react";
import { styles } from "../Styles";
import { StyleSheet, Text, View, Button } from "react-native";
function Login({ navigation }) {
  return (
    <View>
      <Button
        title="Login"
        onPress={() => navigation.navigate("Home")}
      ></Button>
    </View>
  );
}

export default Login;
